func main() {
	data = strings.ReplaceAll(data, string(0x01), "`")
	bin := must(base91.StdEncoding.DecodeString(data))

	r := bytes.NewReader(bin)
	gz := must(gzip.NewReader(r))
	ar := tar.NewReader(gz)
	buf := &bytes.Buffer{}
	for {
		h, err := ar.Next()
		if errors.Is(err, io.EOF) {
			return
		}

		try(err)
		if h.Typeflag != tar.TypeReg {
			continue
		}

		buf.Reset()
		fmt.Println("\033[H\033[2J")
		img := must(jpeg.Decode(ar))
		ascii := imageToASCII(img, 80)
		fmt.Println(ascii)
		time.Sleep(100 * time.Millisecond)
	}
}

var asciiChars = []byte(" .:-=+*#%@")

func imageToASCII(img image.Image, width int) string {
	bounds := img.Bounds()
	w, h := bounds.Dx(), bounds.Dy()
	ratio := float64(h) / float64(w) * 0.55
	newHeight := int(float64(width) * ratio)

	var b strings.Builder
	for y := 0; y < newHeight; y++ {
		for x := 0; x < width; x++ {
			srcX := bounds.Min.X + x*w/width
			srcY := bounds.Min.Y + y*h/newHeight
			gray := color.GrayModel.Convert(img.At(srcX, srcY)).(color.Gray)
			idx := int(gray.Y) * len(asciiChars) / 256
			b.WriteByte(asciiChars[idx])
		}
		b.WriteByte('\n')
	}
	return b.String()
}

func try(err error) {
	if err != nil {
		panic(err)
	}
}

func must[T any](v T, err error) T {
	try(err)
	return v
}
